const AreaDetalles = (props) => {
    return (
        <div id={props.idcss} className={props.clases} >
            {/* <img src={props.sprite} alt="" srcset="" /> */}
            {/* <img src={props.shinySprite} alt="" srcset="" /> */}
            <p>{props.id}</p>
            <p>{props.name}</p>
            <p>{props.species}</p>
            <p>{props.types}</p>
            <p>{props.type2}</p>
            <p>{props.ability}</p>
            <p>{props.hiddenAbility}</p>
            <p>{props.baseEXP}</p>
            <p>{props.height}</p>
            <p>{props.weight}</p>
            <p>{props.hp}</p>
            <p>{props.atk}</p>
            <p>{props.def}</p>
            <p>{props.spAtk}</p>
            <p>{props.spDef}</p>
            <p>{props.speed}</p>
        </div>
    );
}

export default AreaDetalles;
